import React from 'react';
import {
	Route,
	BrowserRouter,
	RouteComponentProps,
	Switch,
	Redirect,
} from 'react-router-dom';
import './App.css';
import Sider from './pages/Dashboard';

function App() {
	return (
		<>
			<BrowserRouter>
				<div>
					<Switch>
						<Route path='/'>
							<Sider />
						</Route>
						<Route path='/dashboard' render={Sider} />
						<Redirect to='404' />
					</Switch>
				</div>
			</BrowserRouter>
		</>
	);
}
export default App;
